" align="left">\n\t\t\t\t\t\t\t\t\t<p>Dear Yusril,<br>\n\t\t\t\t\t\t\t\t\t<br>\n\t\t\t\t\t\t\t\t\tAt Amazon Appstore, we are always innovating on behalf of developers. Over the course of 2018, we have several revamps planned for the Developer Console. Part one of this revamp is focused on improving the multimedia asset upload and app description experiences.<br>\n\t\t\t\t\t\t\t\t\t<br>\n\t\t\t\t\t\t\t\t\tYou can find detailed documentation on these new features <a href="http://m.amazonappservices.com/e/296652/ing-submission-ui-enhancements/5r5vf/137533462" style="text-decoration:none;color:#29b2e4;" target="_blank">here </a>or read our blog with full details and video tutorials <a href="http://m.amazonappservices.com/e/296652/riptions-and-multimedia-assets/5r5vh/137533462" style="color:#29b2e4;text-decoration:none;">here</a>.<br>\n\t\t\t\t\t\t\t\t\t<br>\n\t\t\t\t\t\t\t\t\tThe new Appstore submission experience includes the following features:</p>\n\n\t\t\t\t\t\t\t\t\t<ul>\n\t\t\t\t\t\t\t\t\t\t<li>Bulk upload of screenshots.</li>\n\t\t\t\t\t\t\t\t\t\t<li>Asynchronous upload of multimedia assets.</li>\n\t\t\t\t\t\t\t\t\t\t<li>The ability to preview multimedia assets for Fire tablets and Amazon Fire TV.</li>\n\t\t\t\t\t\t\t\t\t\t<li>Support for Japanese-, German-, and Chinese-specific assets and descriptions.</li>\n\t\t\t\t\t\t\t\t\t\t<li>Refreshed UI, with improved tool tips, micro-copy, and style guides.</li>\n\t\t\t\t\t\t\t\t\t</ul>\n\t\t\t\t\t\t\t\t\tWe hope you enjoy these new improvements. Please keep an eye out for this refresh and feel free to send us <a href="http://m.amazonappservices.com/e/296652/support-contact-us/5r5vk/137533462" style="color:#29b2e4;text-decoration:none;">your feedback</a> through our support team.<br>\n\t\t\t\t\t\t\t\t\t<br>\n\t\t\t\t\t\t\t\t\t- Amazon Appstore</td>\n\t\t\t\t\t\t\t\t</tr>\n\t\t\t\t\t\t\t\t<!-- /Spacer --><!-- Spacer -->\n\t\t\t\t\t\t\t\t<tr>\n\t\t\t\t\t\t\t\t\t<td style="line-height: 50px; font-size: 50px; background: #f