m</a>, Inc. or its affiliates.<br>\n\t\t\t\t\t\t410 Terry Avenue North, Seattle, WA 98109.</p>\n\n\t\t\t\t\t\t<p style="margin:15px 0; font-family: 'helvetica neue', helvetica, arial, sans-serif; font-size: 13px; line-height: 21px;">If you no longer wish to receive these emails you may <a href="http://m.amazonappservices.com/unsubscribe/u/296652/92bd155d3e9917cc9373196e348c5869527b9a7524a441cae5a1bd0cbc64bb55/137533462" style="color:#0066bf; text-decoration:none;" target="_blank">unsubscribe</a> at any time.<br>\n\t\t\t\t\t\t<a href="http://m.amazonappservices.com/e/296652/lic-support-contact-contact-us/5r5w1/137533462" style="color:#0066bf; text-decoration:none;" target="_blank">Contact Us</a> | <a href="\nhttp://m.amazonappservices.com/e/296652/support/5r5w3/137533462" style="color:#0066bf; text-decoration:none;" target="_blank">Support</a></p>\n\t\t\t\t\t\t</td>\n\t\t\t\t\t</tr>\n\t\t\t\t</tbody>\n\t\t\t</table>\n\n\t\t\t<table style="width:100%;" cellspacing="0" cellpadding="0" border="0" width="100%">\n\t\t\t\t<tbody>\n\t\t\t\t\t<tr>\n\t\t\t\t\t\t<td style="line-height: 30px; font-size: 30px;" height="30">&nbsp;</td>\n\t\t\t\t\t</tr>\n\t\t\t\t</tbody>\n\t\t\t</table>\n\t\t\t<!-- /Footer --><!-- Mod Spacer --></td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td style="line-height: 60px; font-size: 60px; background: #eeeeee;" bgcolor="#eeeeee" height="60">&nbsp;</td>\n\t\t</tr>\n\t\t<!-- /Mod Spacer -->\n\t</tbody>\n</table>\n<!--[if (gte mso 9)|(IE)]>\n          </td>\n          </tr>\n          </table>\n        <![endif]--></center>\n</div>\n<img alt="" src="http://m.amazonappservices.com/r/296652/1/137533462/open/1" /><style>@media print{ #_t { background-image: url('https://s57osnal.emltrk.com/s57osnal?p');}} div.OutlookMessageHeader {background-image:url('https://s57osnal.emltrk.com/s57osnal?f')} table.moz-email-headers-table {background-image:url('https://s57osnal.emltrk.com/s57osnal?f')} blockquote #_t {background-image:url('https://s57osnal.emltrk.com/s57osnal?f')} #MailContainerBody #_t {background-image:url('https://s57osnal.emltrk.com/s57osnal?f')}</style><div id="_t"></div>\n<img src="https://s57osnal.emltrk.com/s57osnal" width="1" height="1" border="0" /></body>\n\n</html>\n\n	New developer console experience on Amazon Appstore\n\nDear Yusril,\n\nAt Amazon Appstore, we are always innovating on behalf of developers. Over the course of 2018, we have several revamps planned for the Developer Console. Part one of this revamp is focused on improving the multimedia asset upload and app description experiences.\nYou can find detailed documentation on these new features here: http://m.amazonappservices.com/e/296652/ing-submission-ui-enhancements/5r5vf/137533462\nor read our blog with full details and video tutorials here: http://m.amazonappservices.com/e/296652/riptions-and-multimedia-assets/5r5vh/137533462\n\nThe new Appstore submission experience includes the following features:\n1) Bulk upload of screenshots.\n2) Asynchronous upload of multimedia assets.\n3) The ability to preview multimedia assets for Fire tablets and Amazon Fire TV.\n4) Support for Japanese-, German-, and Chinese-specific assets and descriptions.\n5) Refreshed UI, with improved tool tips, micro-copy, and style guides.\n\nWe hope you enjoy these new improvements. Please keep an eye out for this refresh and feel free to send us your feedback through our support team: http://m.amazonappservices.com/e/296652/support-contact-us/5r5vk/137533462\n\n- Amazon Appstore\n\n© 2017 Amazon.com, Inc. or its affiliates. All rights reserved.\nAmazon and Amazon.com are registered trademarks of Amazon.com, Inc. or its affiliates.\n410 Terry Avenue North, Seattle, WA 98109.\n\nContact Us: http://m.amazonappservices.com/emailpreferences?ehash=92bd155d3e9917cc9373196e348c5869527b9a7524a441cae5a1bd0cbc64bb55&email_id=137533462\nSupport: http://m.amazonappservices.com/emailpreferences?ehash=92bd155d3e9917cc9373196e348c5869527b9a7524a441cae5a1bd0cbc64bb55&email_id=137533462\nUnsubscrib